('1851','18','7595','Villa Paul Ellis',Null,'Luxuriöse Designervilla mit wunderschönem Meerblick in Santa Ponsa ','23016','Diese hochwertige Luxusvilla im glamourösen, licht durchfluteten Design befindet sich in Santa Ponsa und genießt einen atemberaubenden Blick über das Meer und die Bucht von Santa Ponsa. Die Residenz besitzt eine Wohnfläche von 300 m² und verfügt über 4 Schlafzimmer und 4 Badezimmer. Der liebevoll angelegte Garten ist im mediterranen Stil gehalten und bietet einen großartigen Swimmingpool  sowie traumhafte offene und überdachte Terrassen, die zum Verweilen einladen. Vom Anwesen wird ein fesselnder, gigantischer Meerblick und Landschaftsblick auf die gegenüberliegenden Berge geboten. Im unteren Bereich befinden sich ein großes Wohnzimmer mit offenem Kamin, ein Esszimmer sowie eine voll ausgestattete Küche. Die große Außenterrasse bietet genügend Platz zum Sonnen.  Zur weiteren luxuriösen Ausstattung gehören Klimaanlage, Fußbodenheizung, Alarmanlage sowie ein automatisches Bewässerungssystem, Osmoseanlage, Entkalkungsanlage, Bus-System (computergesteuerte Haustechnik) und vieles mehr.','23017','2295000','111','2012-07-26 15:14:37','110','2012-07-26 15:15:37',Null,'1503','121','289',1,'1','0',Null,Null,Null,'23018',Null,'0','0','0',Null,'2015-07-23 15:59:17',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'23019',Null,'23020',Null,'23021',Null,'23022',Null,'23023','0',0,'0');
